import React from 'react';
import logo from './logo.svg';
import './App.css';

import Cart from './components/cart'


function App() 
{
  const games  = ['Red Dead Redemption 2', 'Ruiner', 'Untitled Goose Game']
  const prices = [2499, 0, 499]

  return (
    <div className="App">

      <p>В корзине игр: {games.length}</p>
      <Cart>{games, prices}</Cart>
      <p>Финальная цена: {}</p>

    </div>
  );
}

export default App;
